import React, { useEffect, useState } from 'react'
import { useSearchParams } from "react-router-dom";
import { Container } from './styles'
import { loadUserData, login } from '../../services'

const CreateClickPage = () => {
  const [searchParams, setSearchParams] = useSearchParams()
  const [newClick, setNewClick] = useState<AddClickModel>()

  useEffect(() => {
    searchParams.forEach(value => console.log(value))
    setNewClick({
      idSite: searchParams.get('site_id'),
      siteDomain: searchParams.get('site_domain'),
      thumbnail: searchParams.get('thumbnail'),
      title: searchParams.get('title'),
      timeStamp: searchParams.get('timestamp'),
      platform: searchParams.get('platform'),
      idCampaing: searchParams.get('campaing_id'),
      nameCampaing: searchParams.get('campaing_name'),
      token: searchParams.get('token')
    })

  }, [])

  return (
    <Container>
      {searchParams.get('site_id')}
    </Container>
  )
}

export default CreateClickPage;

export interface AddClickModel {
	idSite?: number,
	siteDomain?: string,
	thumbnail?: string,
	title?: string,
	timeStamp?: string,
	platform?: string,
	idCampaing?: number,
	nameCampaing?: string,
	token?: string
}
